# 可以直接拿到里面的元素,什么元素就.xxx如下
# 拿到元素里面的p
soup.p
# 拿到元素里面的p里面的span
soup.p.span
# 获取p的内容
soup.p.text
# 获取元素的属性值 返回的是一个字典,可能有class和id等等,如果class是有空格的还会分割
soup.p.attrs
# 直接获取class属性的值 []里面写属性名就可以拿到值 返回是列表
soup.p['class']
# 给属性赋值
soup.p['class'] = ['web', 'key']
# 以列表的形式输出所有的子节点,包括\n换行符
soup.p.contents
# 输出所有的孩子节点,包括空行
soup.p.children
# 这是拿到解析之后的html里面所有的a标签 返回的是一个列表
# limit参数就是 我只要前几个这样子
# 注意,因为class是py里面的一个关键字,所以要指定类名的时候要用class_
soup.find_all('a', limit=2, class_="webSite", id="link4")
# 可以批量找,例如批量找a和b标签,然后弄一个列表存起来
soup.find_all(['a','b'])
# 这个的含义就是他只要有id的a都要拿
soup.find_all('a',id=True)

# 根据css属性去查找
soup.select('title')
soup.select('a[href]')
soup.select('.vip')
# 查head里面的title标签
soup.select('head title')
# 查到p的下一个兄弟标签
soup.select('p + a')
# 查找p的兄弟标签(id是link3)
soup.select('p ~ #link3')


# lxml的使用 这个会自动帮你转化为符合规范的html格式
parse_html = etree.HTML(html_doc)
# 输出的是字符串
result = etree.tostring(parse_html)
# 提取的语法是 这其实就是// 后面跟元素名称 然后如果要根据id或者href去拿酒用[@xx=xx]这种形式而已 直接跟@什么就是拿这个元素的属性，如果要文本的话就直接text()  /a[@href="http://baidu.com"]/text()
# //开头就是相对路径的意思
xpath_bds = '//ul[@id="siteweb"]/li/a[@title="哟霸服"]/@href'
r_list = parse_html.xpath(xpath_bds)

